const GitHub = () => {
    return (
        <div className="github">
            <ul className="github-top">
                <li className="github-title info-title">GitHub</li>
                <li className="github-followers">23
                    <span>Followers</span>
                </li>
            </ul>
            <div className="github-subtitle info-subtitle">
                <p>Contributions</p>
                <hr/>
            </div>
        </div>
    );
}

export default GitHub;
